// Input: $json.image_prompts.slide_1 ... slide_4
// Output: slide_1 to slide_4 ready for image generation
// Purpose: enforce style, lighting, negative prompts, and format uniformity

const prompts = $json.output.image_prompts;

function optimize(prompt) {
  if (!prompt) return null;

  // Force cinematic, realistic, high-contrast style
  let optimized = `
${prompt.trim()} 
Cinematic realism. Ultra-detailed. High contrast. Sharp focus. Cold color palette. 
Atmospheric depth. Volumetric lighting. Subtle sci-fi documentary aesthetic. 
High-end neural visualization style. 
`;

  // Add universal negative prompt for consistency
  optimized += `
Negative prompt: 
people, faces, text, letters, words, logos, watermark, low-res, blurry, cartoon, anime, painting, 3d render, distortions, extra limbs, artifacts, oversaturated colors, warm tones, fantasy style, surreal dream shapes, glitching, duplicate objects
`;

  // Clean formatting
  return optimized.replace(/\s+/g, " ").trim();
}

return [
  {
    json: {
      slide_1: optimize(prompts.slide_1),
      slide_2: optimize(prompts.slide_2),
      slide_3: optimize(prompts.slide_3),
      slide_4: optimize(prompts.slide_4)
    }
  }
];
